import React from 'react'
import Svg, { Defs, Path, Pattern, Use, Image, Circle } from 'react-native-svg'
import normalize from 'react-native-normalize'

export function AppLogo({ width = 32, height = 32, props }) {
    return (
        <Svg
            xmlns="http://www.w3.org/2000/svg"
            width={normalize(width)}
            height={normalize(height)}
            fill="none"
            {...props}
        >
            <Path
                stroke="#3C3C3C"
                strokeLinecap="round"
                strokeWidth={120}
                d="m195.297 60.423-65.567 69.155"
            />
            <Path
                stroke="#FF5367"
                strokeLinecap="round"
                strokeWidth={120}
                d="m60.43 62.928 67.688 67.068"
            />
            <Circle cx={205} cy={50} r={10} fill="#FF5367" />
            <Circle cx={130} cy={140} r={10} fill="#3C3C3C" />
        </Svg>
    )
}

